(function(){
	"use strict";

//var cat1_base64 = '';
var cat1_base64 = '';
var catsx1 = 68;
var catsx2 = 128;
var catsy = 108;

function get_id(i) {
	var e = document.getElementById(i);

	if (!e)
		throw ('get_id(\'' + i + '\') failed');

	return e;
}
function listener_add(el, ev, cb) {
	if (el.addEventListener)
		el.addEventListener(ev, cb, false);
	else
		el.attachEvent('on' + ev, cb);
}
function document_size() {
	return [
		document.documentElement.clientWidth,
		document.documentElement.clientHeight
	];
}
function window_size() {
	var wx, wy;
	if (window.innerWidth) {
		wx = window.innerWidth;
		wy = window.innerHeight;
	}
	if (!wx && document.documentElement) {
		wx = document.documentElement.clientWidth;
		wy = document.documentElement.clientHeight;
	}
	if (!wx) {
		var body = document.body || document.getElementsByTagName('body')[0];
		if (body) {
			if (body.clientWidth) {
				wx = body.clientWidth;
				wy = body.clientHeight;
			} else if (body.offsetWidth) {
				wx = body.offsetWidth;
				wy = body.offsetHeight;
			}
		}
	}

	return [wx, wy];
}
function get_key(ev) {
	ev = ev ? ev : this.event;
	return ev.keyCode ? ev.keyCode : ev.which;
}
function window_scroll() {
	var x = 0;
	var y = 0;

	if (self.pageYOffset) {
		x = self.pageXOffset;
		y = self.pageYOffset;
	} else if (document.documentElement && document.documentElement.scrollTop) {
		x = document.documentElement.scrollLeft;
		y = document.documentElement.scrollTop;
	} else if (document.body) {
		x = document.body.scrollLeft;
		y = document.body.scrollTop;
	}

	return [x, y];
}







var obs = [];

var key_held = []; // auto set to false when key lifted
var cat;
var x = 100 + catsx1;
var y = 100 + catsy;
var astep = 0;
var stillstep = 0;
var catstate = 0;
var jumping = false;
var jumpvel = 0;
var movespeed = 4*2;
var bounds;
var focused = true;
var inited = false;

var catstates = [
	[catsx1*0,  0, catsx1, catsy],
	[catsx1*1,  0, catsx1, catsy],
	[catsx1*2,  0, catsx1, catsy],
	[catsx1*3,  0, catsx1, catsy],
	[catsx1*4,  0, catsx1, catsy],
	[catsx1*5,  0, catsx1, catsy],
	[catsx1*6,  0, catsx1, catsy],

	[catsx2*0, catsy*1, catsx2, catsy],
	[catsx2*1, catsy*1, catsx2, catsy],
	[catsx2*2, catsy*1, catsx2, catsy],
	[catsx2*3, catsy*1, catsx2, catsy],

	[catsx2*0, catsy*2, catsx2, catsy],
	[catsx2*1, catsy*2, catsx2, catsy],
	[catsx2*2, catsy*2, catsx2, catsy],
	[catsx2*3, catsy*2, catsx2, catsy]
];

(function() {
	// add a cat when CAT is typed
	var buffer = '';
	if(document.body) {
		listener_add(document.body, 'keydown', function(e) {
			if(document.activeElement &&
			   document.activeElement.tagName.match(/^(INPUT|TEXTAREA)$/)) {
				return;
			}

			var k = get_key(e);
			k = String.fromCharCode(k);
			if(k == 'C') {
				buffer = k;
				return;
			}

			if(!buffer.length) {
				return;
			}

			buffer += k;
			if(buffer == 'CAT') {
				catify();
				buffer = '';
			}else if(buffer.length > 3) {
				buffer = '';
			}
		});
	}
}());

function catify() {
	if(!document.createRange)
		return; // :'(

	if(!inited) {
		init();
	}

	cat = document.createElement('div');
	cat.style.position = 'absolute';
	//cat.style.backgroundImage = 'url("images/cat/atlas/cat1.png")';
	cat.style.backgroundImage = 'url("data:image/png;base64,' + cat1_base64 +'")';
	cat.style.backgroundRepeat = 'no-repeat';
	cat.className = 'catify';

	listener_add(cat, 'click', function(e) {
		focused = !focused;
	});
	listener_add(cat, 'dblclick', function(e) {
		cat.parentNode.removeChild(cat);
		cat = null;
	});

	// set the cat atop a random spot on the page
	//var at = obs[Math.floor(Math.random() * obs.length)];
	//x = at.left + Math.floor(at.width * 0.5);
	//y = at.top - 1;
	x = Math.floor(bounds[0] * 0.3);
	y = 0;

	draw();
	document.body.appendChild(cat);

	if(!inited) {
		setInterval(update, 16);
		inited = true;
	}
}

function init() {
	var i;

//	listener_add(window, 'resize', resize);
//	listener_add(window, 'scroll', resize);
	setInterval(resize, 200);
	resize();

	for(i = 0; i < 255; i++) {
		key_held[i] = false;
	}

	listener_add(document, 'keydown', function(e) {
		if(!has_focus()) { return; }

		var k = get_key(e);
		key_held[k] = true;

		if(k >= 37 && k <= 40) {
			e.preventDefault();
		}
	});

	listener_add(document, 'keyup', function(e) {
		if(!has_focus()) { return; }

		var k = get_key(e);
		key_held[k] = false;

		if(k >= 37 && k <= 40) {
			e.preventDefault();
		}
	});
}

function has_focus() {
	if(!focused || !cat) {
		 return false;
	}

	if(document.activeElement &&
	   document.activeElement.tagName.match(/^(INPUT|TEXTAREA)$/)) {
		return false;
	}

	return true;
}

function update(force) {
	if(astep > 1000000)
		astep = 0;

	var ox = x;
	var oy = y;

	var catrect = {
		'top': y - catstates[catstate][3],
		'left': x,
		'width':catstates[catstate][2],
		'height': catstates[catstate][3]
	};
	var sitting = collide(catrect, obs);
	var cantfall = false;

	//if(y + catstates[catstate][3] >= bounds[1]) {
	if(y + 2 > bounds[1]) {
		sitting = true;
		cantfall = true;
	}

	if(key_held[37])
		x = x - movespeed;

	if(key_held[39])
		x = x + movespeed;

	if(x < 0)
		x = 0;

	if(x + catstates[catstate][2] > bounds[0] - 30)
		x = bounds[0] - catstates[catstate][2] - 30;

	if(key_held[38] && !jumping && sitting) {
		jumping = true;
		jumpvel = 20;
	}

	if(key_held[40] || (!jumping && !sitting && !cantfall)) {
		y = y + movespeed * 2;
	}

	if(jumping) {
		y = y - jumpvel;

		if(y - catstates[catstate][3] < 0)
			y = catstates[catstate][3];

		jumpvel--;
		if(jumpvel == -1)
			jumping = false;
	}

	//if(y + catstates[catstate][3] > bounds[1]) {
	//	y = bounds[1] - catstates[catstate][3];
	//}
	if(y + 1 > bounds[1]) {
		y = bounds[1] - 1;
	}
	if(y - catstates[catstate][3] < 0) {
		y = catstates[catstate][3];
	}

	if(x == ox && y == oy) {
		if(stillstep <= 0) {
			stillstep = Math.floor(Math.random() * 20) + 20;
			astep = Math.floor(Math.random() * 100000);
		}
		stillstep--;

		catstate = astep % 7;
		draw();
		return;
	}

	astep++;

	var walka = Math.floor(astep / 2) % 4;

	if(x > ox)
		catstate = 11 + walka;
	else
		catstate = 7 + walka;

	draw();
}

function draw() {
	bg(cat, catstates[catstate]);
	cat.style.left = x+'px';
	cat.style.top = (y - catstates[catstate][3])+'px';
}

function bg(e, a) {
	e.style.width = a[2]+'px';
	e.style.height = a[3]+'px';
	e.style.backgroundPosition = (-a[0]) + 'px ' + (-a[1]) + 'px';
}

function collide(o, list) {
	var i, l;
	for(i = 0; i < list.length; i++) {
		l = list[i];
		//if(l.top > o.top + o.height)
		//	continue;
		//if(l.top + l.height < o.top)
		//	continue;
		if(o.top + o.height < l.top)
			continue;
		if(o.top + o.height > l.top + movespeed)
			continue;
		if(l.left > o.left + o.width)
			continue;
		if(l.left + l.width < o.left)
			continue;
		return true;
	}
	return false;
}

function resize() {
	var body = document.body;

	obs = [];

	var scr = window_scroll();

	all_text_nodes(body, function(e) {
		var range = document.createRange();
		range.selectNodeContents(e);
		var rects = range.getClientRects();
		var dims;
		for(var i = 0; i < rects.length; i++) {
			dims = {
				top: rects[i].top + scr[1],
				left: rects[i].left,
				width: rects[i].width,
				height: rects[i].height
			};
			obs.push(dims);

/*			d = document.createElement('div');
			d.style.position = 'absolute';
			d.style.backgroundColor = '#f00';
			d.style.opacity = 0.5;

			d.style.left = dims.left+'px';
			d.style.top = dims.top+'px';
			d.style.width = dims.width+'px';
			d.style.height = dims.height+'px';

			d.appendChild(document.createTextNode(''));
			document.body.appendChild(d);*/
		}
	});

	bounds = document_size();
	var w = window_size();
	if(bounds[1] < w[1])
		bounds[1] = w[1];
}

function all_text_nodes(element, cb)
{
	if(element.childNodes.length > 0)
		for(var i = 0; i < element.childNodes.length; i++)
			all_text_nodes(element.childNodes[i], cb);

	if(element.nodeType == Node.TEXT_NODE && /\S/.test(element.nodeValue))
		cb(element);
}

window.catify = catify;
})();

